text:
@SenWarren claim: Prices are going up across all sectors, including energy, apparel, and back-to-school goods.
 
FALSE!
 
FACT: Prices are actually going down. 15 popular back-to-school items are down an average of 7% from last year, according to Consumer Affairs.

@SenateGOP and @WhiteHouse are lowering costs and cutting taxes for hard-working Americans.

177,000 more workers got up and went to work than last month. And workforce participation increased by 518,000. This is GREAT news for America!
 
@POTUS and @SecretaryLCD are getting America back to work. This is what restoring the country looks like.
https://t.co/F7tcZqAA0e

Financial literacy can increase economic success for all Americans. That’s why as Governor of Nebraska, I made April Financial Awareness Month.
 
@SecScottBessent is right. Everyone should care about financial literacy.
https://t.co/NPapJsXhjQ
